import React from "react";
import ToDoListItem from './to-do-list-item'

let ToDoList = ({todos}) => {
    let elements = todos.map((item) => {
        let keyStr = item.label.split(' ').reduce((sum, word) => sum += word[0], "").join('');
        return <li><ToDoListItem key={keyStr} important={item.important} label={item.label} /> </li>;
    });
    return (
        <ul>
            {elements}
        </ul>
    )
};
export default ToDoList
